function onFire() {
    var element = document.createElement("meta")
    element.name = "apple-mobile-web-app-capable"
    element.content = "yes";
    document.head.appendChild(element);

    var element3 = document.createElement("link")
    element3.rel = "apple-touch-icon"
    element3.href = "data:image/png;base64,";
    document.head.appendChild(element3);
    alertOK("Site is now ready for webApp");
}
